import React from "react";

const DomList = ({ list }) => (
  <>
    {list.map((com) => (
      <div className="col-12" key={com.createTime}>
        <div className="row">
          <h3>{com.username + " : " + com.message}</h3>
        </div>
      </div>
    ))}
  </>
);

export default DomList;
